// ==UserScript==
// @name         Enable Overflow Scroll on Luscious
// @namespace    https://github.com/Official-Husko/violentmonkey-scripts
// @version      1.0
// @description  Enables scrolling when using an adblock.
// @match        https://members.luscious.net/*
// @match        https://luscious.net/*
// @grant        none
// @license      GNU GPLv3
// @author       Official-Husko
// @icon         data:image/png;base64,
// @downloadURL https://update.greasyfork.org/scripts/482289/Enable%20Overflow%20Scroll%20on%20Luscious.user.js
// @updateURL https://update.greasyfork.org/scripts/482289/Enable%20Overflow%20Scroll%20on%20Luscious.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Wait for 3 seconds before applying the CSS rule
    setTimeout(function() {
        // Add a CSS rule to change hidden overflow to visible for body elements with class o-modal-no-scroll
        const style = document.createElement('style');
        style.innerHTML = 'body.o-modal-no-scroll { overflow: visible !important; }';
        document.head.appendChild(style);
    }, 3000); // 3000 milliseconds = 3 seconds
})();